import { createGlobalStyle } from "styled-components";

export const GlobStyled = createGlobalStyle`
*{
    margin: 0;
    padding: 0;
    box-sizing:border-box;
    font-family: 'Poppins', sans-serif;
 }`;
export default GlobStyled;
